import React from 'react';
import './Skills.css'; // Assurez-vous de créer ce fichier CSS pour le style

function Skills() {
  // Tableau de compétences
  const skills = [
    { id: 1, title: 'JavaScript', description: 'Description de la compétence 1', image: 'js.png' },
    { id: 2, title: 'Java', description: 'Description de la compétence 2', image: 'java.png' },
    { id: 4, title: 'Kali Linux Tools', description: 'Description de la compétence 3', image: 'kali.png' },    
    { id: 4, title: 'React.js', description: 'Description de la compétence 1', image: 'react.png' },
    { id: 5, title: 'MySQL', description: 'Description de la compétence 2', image: 'mysql.png' },
    { id: 6, title: 'C', description: 'Description de la compétence 3', image: 'c.png' },
    { id: 7, title: 'Git', description: 'Description de la compétence 3', image: 'git.png' },
    { id: 8, title: 'Bash', description: 'Description de la compétence 3', image: 'linux.png' },
    // { id: 9, title: 'C', description: 'Description de la compétence 3', image: 'kali.png' },
    // { id: 10, title: 'C', description: 'Description de la compétence 3', image: 'kali.png' },

  ];

  return (
    <div className="skills-container">
      <div className="skill-thumbnails">
        {skills.map(skill => (
          <div key={skill.id} className="skill-thumbnail">
            <div className="thumbnail-image">
              <img src={skill.image} alt={skill.title} />
            </div>
            <div className="skill-details">
              <h2>{skill.title}</h2>
              <p>{skill.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Skills;
